import React from 'react'
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Bookshelf</h1>
      <input type='text' name='title'/>
      <input type='text' name='author'/>
      <input type='text' name='genre'/>
      <input type='number' name='rating'/>
      <input type='review' name='review'/>
    </div>
  );
}

export default App;
